import React from "react";
import flatbedBanner from "../assets/flatbed_banner.jpg";
import logo from "../assets/logo.png";
import "../styles/Home.css";

const Home = () => {
  return (
    <div className="home-container">
      {/* Logo */}
      <div className="logo-container">
        <img src={logo} alt="App Logo" className="logo" />
      </div>

      {/* Banner */}
      <div className="banner-container">
        <img
          src={flatbedBanner}
          alt="Flatbed Carrying Car"
          className="banner-image"
        />
      </div>

      {/* Text and Button */}
      <h1>Welcome to Car Rescue Service</h1>
      <p>Book a flatbed truck for your car rescue anytime, anywhere.</p>
      <a href="/booking">
        <button className="book-button">Book Now</button>
      </a>
    </div>
  );
};

export default Home;
